import Landing from "./Landing.js";
import { Button } from "react-bootstrap";
function Home() {
  return (
    <div>
      <div>
        <Button>1</Button>
        <Button>2</Button>
        <Button>3</Button>
      </div>
      <Landing />
    </div>
  );
}

export default Home;
